import React, { useState, useEffect } from "react";
import { getDoctorProfile } from "../services/api";

const Profile = () => {
  const [profile, setProfile] = useState(null);
  const [error, setError] = useState("");

  const fetchProfile = async () => {
    try {
      const profileData = await getDoctorProfile();  // This should work if token and userId are available
      console.log("Fetched Profile Data:", profileData); // Debug log to check fetched data
      setProfile(profileData); // Set the profile data
    } catch (error) {
      console.error("Error fetching profile:", error);
      setError("Failed to load profile. Please try again.");
    }
  };

  useEffect(() => {
    fetchProfile();  // Fetch profile when component mounts
  }, []);

  return (
    <div className="profile">
      {error && <p className="error">{error}</p>}
      {profile ? (
        <div>
          <h2>{profile.name}</h2>
          <p>Degree: {profile.degree}</p>
          <p>Email: {profile.email}</p>
          <p>Phone: {profile.phone_number}</p>
          <p>City: {profile.city}</p>
          <p>Description: {profile.description}</p>
          <p>Hospital: {profile.hospital}</p>
          <p>Experience: {profile.experience} years</p>
          <p>Fees: {profile.fees}</p>
          <p>Top Expertise: {profile.top_expertise}</p>
          <p>Rating: {profile.rating}</p>
          <p>Address: {profile.address}</p>
          <p>Area: {profile.area}</p>
        </div>
      ) : (
        <p>Loading profile...</p>
      )}
    </div>
  );
};

export default Profile;
